def process_messages(n, k, id_list):
    que = deque()
    used = set()
    for id in id_list:
        if id not in used:
            continue
        else:
            if len(que) >= k:
                q = que.pop()
                used.remove(q)
            que.appendleft(id)
            used.add(id)
    m = len(que)
    conversation_list = list(que)
    return (m, conversation_list)

